        return 0
    elif n == 1:
        return 1
    elif n == 2:
        return 1
    seq = [0] * n
    seq[0] = 0
    seq[1] = 1
    seq[2] = 1
    for i in range(3, n):
        seq[i] = seq[seq[i-1]] + seq[i - seq[i-1]]
    return seq[n-1]
