def nth_newman_shanks_williams_prime(n):
    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    def ns_w_prime(k):
        if k == 0:
            return 3
        elif k == 1:
            return 5
        else:
            return (ns_w_prime(k - 1) ** 2 - 2) ** 2 - 2

    count = 0
    k = 0
    while True:
        p = ns_w_prime(k)
        if is_prime(p):
            count += 1
            if count == n:
                return p
        k += 1
