        return 0
    nums.sort()
    dp = [1] * len(nums)
    parent = [0] * len(nums)
    max_len = 1
    max_index = 0
    for i in range(len(nums)):
        for j in range(i):
            if nums[i] % nums[j] == 0 and dp[j] + 1 > dp[i]:
                dp[i] = dp[j] + 1
