import subprocess
import psutil
import time
import os

def task_func(script_path: str, timeout=10) -> dict:
    if not os.path.exists(script_path):
        return {'CPU Usage': 0, 'Memory Usage': 0}
    process = None
    try:
        process = subprocess.Popen(script_path, stdout=subprocess.PIPE, stderr=subprocess.PIPE, shell=True)
        start_time = time.time()
        cpu_usage = 0
        memory_usage = 0
        while True:
            if process.poll() is not None:
                break
            if time.time() - start_time > timeout:
                process.terminate()
                process.wait()
                break
            try:
                p = psutil.Process(process.pid)
                cpu_usage += p.cpu_percent(interval=0.1)
                memory_usage += p.memory_rss()
            except psutil.NoSuchProcess:
                break
        return {'CPU Usage': cpu_usage, 'Memory Usage': memory_usage}
    except Exception as e:
        return {'CPU Usage': 0, 'Memory Usage': 0}

